import React, {Component} from 'react';
import './App.css';
import Navigation from './Components/Navigation/Navigation.js';
import Logo from './Components/Logo/Logo';
import Url from './Components/Url/Url'
import Rank from './Components/Rank/Rank'
import Particles from 'react-particles-js';


const Clarifai = require('clarifai');

const app = new Clarifai.App({
 apiKey: '5961e5754fb443c5b97ff1b8b3cc9e1d'
});

app.models.predict(Clarifai.COLOR_MODEL, 'https://www.gardeningknowhow.com/wp-content/uploads/2019/04/lawn-pH.jpg')
      .then(response => {
        console.log(response);
      })
      .catch(err => {
        console.log(err);
      });

const particleOptions = {
    particles: {
        number: {
          value: 3000,
          density: {
            enable:true,
            value_area: 1000
          }
        }
    },
    "interactivity": {
          "events": {
              "onhover": {
                  "enable": true,
                  "mode": "repulse"
              }
          }
      }
}


class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      input: '',
    }
  }

  onInputChange = (event) => {
    this.setState({input: event.target.value});
    console.log(this.state.input);
  }

  onSubmit = () => {
    console.log('click')
  }

  render() {
    return (
      <div className="App">
        <Particles className='particles' 
          params={{particleOptions}} />
        <Navigation />
        <Logo />
        <Rank />
        <Url onInputChange = {this.onInputChange} onSubmit = {this.onSubmit}/>
      </div>
    );
  }
}

export default App;
